#
# CORRECT STRUCTURE FOR: orders
#

UPDATE orders as o 
INNER JOIN (SELECT id, count(book_id) AS cb from orders_books GROUP BY order_id ) AS ob ON o.id = ob.id
SET o.total = ob.cb;

